import React from 'react';

const FAQSection = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-[#F8F7F0] p-8">
      {/* Заголовок */}
      <div className="text-center mb-8">
        <h1 className="text-4xl font-bold text-gray-800 mb-4">Frequently Asked Questions</h1>
        <h2 className="text-2xl text-gray-600">You’ve Any Questions</h2>
      </div>

      {/* Основной контент */}
      <div className="max-w-4xl w-full bg-white rounded-lg shadow-lg p-8">
        {/* Секция с текстом */}
        <div className="mb-8">
          <h3 className="text-2xl font-bold text-gray-800 mb-4">World’s hottest destinations for vegans</h3>
          <p className="text-gray-600 mb-4">
            Let’s grow naturally and live naturally
          </p>
          <p className="text-gray-600">
            Suspendless finibus uma natura, vitae consequat quem vai. Vestibulum leo ligula, molestia ultimcorper vulputate vitae sodales commodo nisi. Nulla facilisi. Pellentesque est mature many of some form.
          </p>
        </div>

        {/* Разделитель */}
        <hr className="border-gray-200 mb-8" />

        {/* Секция с заголовком и текстом */}
        <div className="mb-8">
          <h3 className="text-2xl font-bold text-gray-800 mb-4">Best vegetables for your healthy hair</h3>
        </div>

        {/* Кнопка или контактная информация */}
        <div className="text-center">
          <p className="text-gray-600 mb-4">Call us anytime</p>
          <button className="bg-[#EEC044] text-white font-semibold py-2 px-6 rounded-lg hover:bg-[#DAA520] transition duration-300">
            Contact Us
          </button>
        </div>
      </div>
    </div>
  );
};

export default FAQSection;
